import React from "react";
import { Routes, Route } from "react-router-dom";
import Footer from "./components/Footer";
import BeamProfile from "./components/Onefile";



function App() {
  return (
    <>
     
      <Routes>
        <Route
          path="/"
          element={
            <>
              <BeamProfile />
              
            </>
          }
        />
        
      </Routes>
     
        <Footer />
      
    </>
  );
}

export default App;
